import React, { Component } from "react";

class CreditTab extends Component {
  state = {};
  render() {
    return (
      <div>
        <div
          style={{
            fontFamily: "Helvetica",
            fontWeight: 300,
            marginTop: 50,
            marginBottom: 100,
          }}
        >
          Website developed by Zubin Hydrie
        </div>
      </div>
    );
  }
}

export default CreditTab;
